import './App.css';
import SignUp from './components/SignUp';
import Entry from './components/Entry';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<Entry />}/>
        <Route exact path="/signup" element={<SignUp />}/>
      </Routes>
    </Router>
  );
}

export default App;
